import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import Navbar from '../components/Navbar';
import './Profile.css';

function Profile() {
  const [user, setUser] = useState(null);
  const userEmail = 'john.doe@example.com'; // Replace with actual logged in user's email

  useEffect(() => {
    fetch(`http://localhost:4000/login/{userEmail}`)
      .then(response => response.json())
      .then(data => setUser(data))
      .catch(error => console.error('Error fetching user data:', error));
  }, [userEmail]);

  if (!user) {
    return <div>Loading...</div>;
  }

  return (
    <div className="profile-container">
      <Navbar />
      <div className="profile-title">
        <h3>Profile</h3>
      </div>
      <div className="profile-form">
        <div className="profile-form-group">
          <label className="profile-form-label">Name</label>
          <input className="profile-form-input" type="text" value={user.name} disabled />
        </div>
        <div className="profile-form-group">
          <label className="profile-form-label">College</label>
          <input className="profile-form-input" type="text" value={user.college} disabled />
        </div>
        <div className="profile-form-group">
          <label className="profile-form-label">Email</label>
          <input className="profile-form-input" type="email" value={user.email} disabled />
        </div>
        <Link className="profile-form-button" to="/settings">Edit Profile</Link>
      </div>
    </div>
  );
}

export default Profile;
